'use strict';

var test = import('tape');

var E = import('../');
var R = import('../range');
var Ref = import('../ref');
var S = import('../syntax');
var T = import('../type');

test('errors', function (t) {
	t.equal(E, Error);
	t.equal(R, RangeError);
	t.equal(Ref, ReferenceError);
	t.equal(S, SyntaxError);
	t.equal(T, TypeError);

	t.end();
});
